import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Switch,
} from "react-router-dom";

import Seconds from "./Seconds";

import "./App.css";
import "./reset.css";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Routes>
            <div>
              aaa
              <Route path="/" element={<Seconds />} />
            </div>
          </Routes>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
